import { useState } from "react";
import { useNavigate } from "react-router-dom";
import { client } from "../api/graphqlClient";
import { CREAR_COMPROBADOR_ADMIN_MUTATION, CREATE_USUARIO_MUTATION } from "../api/adminQueries";

export default function AdminForms() {
  const [uNombre, setUNombre] = useState("");
  const [uApellido, setUApellido] = useState("");
  const [uCorreo, setUCorreo] = useState("");
  const [uPassword, setUPassword] = useState("");
  const [uTelefono, setUTelefono] = useState("");

  const [cCI, setCCI] = useState("");
  const [cNombreUsuario, setCNombreUsuario] = useState("");
  const [cCupos, setCCupos] = useState(0);
  const [msgComp, setMsgComp] = useState("");
  const [loadingComp, setLoadingComp] = useState(false);
  const navigate = useNavigate();


  const handleCreateComprobador = async (e) => {
    e.preventDefault();
    setMsgComp("");
    setLoadingComp(true);
    try {
      if (!uPassword || uPassword.length < 6) {
        setMsgComp("La contraseña debe tener al menos 6 caracteres.");
        setLoadingComp(false);
        return;
      }
      const userVariables = {
        input: {
          nombre: uNombre,
          apellido: uApellido,
          correo: uCorreo,
          password: uPassword,
          telefono: uTelefono,
        },
      };

      const userRes = await client.request(CREATE_USUARIO_MUTATION, userVariables);
      const createdUser = userRes?.crearUsuario;
      if (!createdUser || !createdUser.id) {
        throw new Error("No se creó el usuario");
      }

      const compVariables = {
        usuarioId: createdUser.id,
        ci: cCI,
        nombreUsuario: cNombreUsuario || `${uNombre} ${uApellido}`,
        cuposDisponibles: Number(cCupos) || 0,
      };

      await client.request(CREAR_COMPROBADOR_ADMIN_MUTATION, compVariables);

      setMsgComp("Usuario y comprobador creados correctamente");
      setUNombre("");
      setUApellido("");
      setUCorreo("");
      setUPassword("");
      setUTelefono("");
      setCCI("");
      setCNombreUsuario("");
      setCCupos(0);
      navigate("/comprobadores");
    } catch (err) {
      console.error(err);
      const serverMessage = err?.response?.errors?.[0]?.message || err.message || String(err);
      setMsgComp(`Error: ${serverMessage}`);
    } finally {
      setLoadingComp(false);
    }
  };


  return (
    <div className="space-y-8">
      <h2 className="text-2xl font-bold">Formularios administrativos</h2>

      <section className="bg-white p-4 rounded shadow">
        <h3 className="font-semibold mb-2">Crear Comprobador</h3>
        <form onSubmit={handleCreateComprobador} className="space-y-2">
          <div className="grid grid-cols-2 gap-2">
            <input value={uNombre} onChange={(e) => setUNombre(e.target.value)} placeholder="Nombre" className="w-full p-2 border rounded" />
            <input value={uApellido} onChange={(e) => setUApellido(e.target.value)} placeholder="Apellido" className="w-full p-2 border rounded" />
          </div>
          <input value={uCorreo} onChange={(e) => setUCorreo(e.target.value)} placeholder="Correo" className="w-full p-2 border rounded" />
          <div className="grid grid-cols-2 gap-2">
            <input value={uPassword} onChange={(e) => setUPassword(e.target.value)} placeholder="Password" type="password" className="w-full p-2 border rounded" />
            <input value={uTelefono} onChange={(e) => setUTelefono(e.target.value)} placeholder="Teléfono" className="w-full p-2 border rounded" />
          </div>

          <hr />
          <div className="grid grid-cols-2 gap-2">
            <input value={cCI} onChange={(e) => setCCI(e.target.value)} placeholder="CI" className="w-full p-2 border rounded" />
            <input value={cNombreUsuario} onChange={(e) => setCNombreUsuario(e.target.value)} placeholder="Nombre comprobador (opcional)" className="w-full p-2 border rounded" />
          </div>
          <input value={cCupos} onChange={(e) => setCCupos(e.target.value)} placeholder="Cupos disponibles (opcional)" type="number" className="w-full p-2 border rounded" />
          <div className="flex items-center space-x-2">
            <button className="bg-orange-500 text-white px-4 py-2 rounded" disabled={loadingComp}>{loadingComp ? 'Creando...' : 'Crear'}</button>
            {msgComp && <span className="text-sm">{msgComp}</span>}
          </div>
        </form>
      </section>
    </div>
  );
}
